def day5(data):
    data = list(data)

    counter = 0
    while(counter < len(data) - 1):
        if abs(ord(data[counter]) - ord(data[counter + 1])) == abs(ord('a') - ord('A')):
            del data[counter:counter+2]
        elif (abs(ord(data[counter-1]) - ord(data[counter])) == abs(ord('a') - ord('A'))) and counter != 0:
            del data[counter-1:counter+1]
            counter -= 1
        else:
            counter += 1

    return(len(data))

